DECLARE
  existing_tin TEXT;
BEGIN
  SELECT tin_normalized INTO existing_tin
  FROM parties
  WHERE name_normalized = NEW.name_normalized
    AND deleted_at IS NULL
    AND id != COALESCE(NEW.id, '00000000-0000-0000-0000-000000000000'::uuid);

