CREATE FUNCTION public.validate_country_code_update() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  collision_count INT;
BEGIN
  IF OLD.country_code IS NULL AND NEW.country_code IS NOT NULL THEN
    SELECT COUNT(*) INTO collision_count
    FROM parties
    WHERE country_code = NEW.country_code
      AND tin_normalized = NEW.tin_normalized
      AND deleted_at IS NULL
      AND id != NEW.id;

